@nikomatsakis constant evaluation is not yet addressed.

I don't know whether we have a reliable way to _force_ the debug-assertions off, though that sounds like a good thing to have if we do not already have it.  I will investigate.

(Still, we probably can land this and leave those as to-do items.  In particular, we need to deal with const-evaluation for _every_ operation; not just shifts, and that still remains to be done.)
